86bu-07.jpg"><br><font size="3"></font></div><br></td></tr></table></td></tr></table><table width="600" border="0" align="center" cellpadding="1" cellspacing="0"><tr><td width="600" valign="top" align="left"><br><font size="3">「すっぽりしっかり張るんです」は金属フィルターを取り外し、ストレッチ棒を通したフィルターをフード開口部に張着するタイプの換気扇用フィルターなので吸気性は抜群、かつフード内部が油汚れすることがありません。ストレッチ棒を使用するので60～90cmの換気扇フードであれば、サイズフリーで装着が可能です。フィルター両端にストレッチ棒を差し込み、張るだけなので装着も簡単です!!</font></td></tr></table><br><span style="padding:0;margin:0;font-size:0;color:#fff;">fk094igrjs</span><!--ab--><!--ab2015.6-->■お取り寄せの為、ご注文を頂いた時点で完売となっている可能性がございます。  その場合はご連絡させて頂きますので予めご了承ください<br><table width="300" border="0" cellspacing="0" cellpadding="0"><tr><td><font color="#333333" size="-1">「すっぽりしっかり張るんです」は金属フィルターを取り外し、ストレッチ棒を通したフィルターをフード開口部に張着するタイプの換気扇用フィルターなので吸気性は抜群、かつフード内部が油汚れすることがありません。ストレッチ棒を使用するので60～90cmの換気扇フードであれば、サイズフリーで装着が可能です。フィルター両端にストレッチ棒を差し込み、張るだけなので装着も簡単です!!</font></td></tr></table><br><table width="300" border="0" cellpadding="5" cellspacing="1" bgcolor="#666666"><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">サイズ</font></td><td align="left"><font color="#333333" size="-1">ストレッチ棒:58～102cm、フィルター:101×71cm</font><br><font color="#333333" size="-1">個装サイズ：60×20×5cm</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">重量</font></td><td align="left"><font color="#333333" size="-1">個装重量：300g</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">素材・材質</font></td><td align="left"><font color="#333333" size="-1">ストレッチ棒:ステンレス<br>フィルター:難燃ポリエステル50％、難燃レーヨン・その他50％</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">仕様</font></td><td align="left"><font color="#333333" size="-1">対応レンジフード60cm～90cm　</font><br></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">セット内容</font></td><